import React, {useEffect} from 'react'

function Webapp(){

  useEffect(() => {
    var headers = {
        'AccountKey' : 'b5NRmQ28QUSAE/qVP8jx2g==',
        'accept': 'application/json',
    }
    console.log(headers)
    fetch('http://datamall2.mytransport.sg/ltaodataservice/BusArrivalv2?BusStopCode=66211')
          .then(response => response.json())
  })

  return(
    <div className="section middle-container">
      <h1>Nextbus</h1>
    </div>
  )
}

export default Webapp
